  assertArrayEquals(bbar,bresult.get(1));
  bresult=jedis.blpop(0.11,bfoo,bfoo1);
  assertNull(bresult);
  jedis.lpush(bfoo,bbar);
  jedis.lpush(bfoo1,bcar);
  bresult=jedis.blpop(1d,bfoo,bfoo1);
